// Header.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <nav className="flex items-center justify-center py-4 sticky top-0 z-10 bg-transparent">
      {/* Container for the links with limited width and background */}
      <div className="flex space-x-20 px-8 py-2 bg-black bg-opacity-90 rounded-lg ">
        <Link to="/home" className="text-lg font-medium hover:text-yellow-400">Home</Link>
        <Link to="/game" className="text-lg font-medium hover:text-yellow-400">Game</Link>
        <Link to="/about" className="text-lg font-medium hover:text-yellow-400">About</Link>
      </div>
    </nav>
  );
};

export default Header;
